import React from 'react';

const LoginStyled= styled.div`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
  backgroud-color: red,
`;

export default function LoginPage() {
    return (
        <LoginStyled> Login Page </LoginStyled>
    );
  }
